DROP TABLE IF EXISTS geophoto_geometry;

CREATE TABLE geophoto_geometry
(
  gid integer NOT NULL,
  kmlid numeric(10,0),
  name character varying(254),
  symbolid numeric(10,0),
  description character varying(254),
  imagepath  character varying(1024),
  geom geometry(PointZM),
  CONSTRAINT geophoto_geometry_pkey PRIMARY KEY (gid)
)
WITH (
  OIDS=FALSE
);
ALTER TABLE public.geophoto_geometry
  OWNER TO postgres;






